window.bookSummaryJSON = "<p>Humanity stands at the brink of extinction.</p> <p>Earth has been bombarded by forces beyond our understanding.</p> <p>In the aftermath, monsters rule the Earth while humanity is forced into a few small safe zones, but not all is lost.</p> <p>When the shadows fell, so too did hope. Progentitor rays birthed a new breed of humans, known as supers. Now those few are all that stands between mankind and death upon the claws and fangs of monsters.</p>"; 
